// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";
import "./Consent.sol";

contract Access is Initializable, UUPSUpgradeable, OwnableUpgradeable {

    struct ResourceAccess {
        address user;
        address researcher;
        bytes32 resourceShared;
        uint256 sharedDate;
        bool shared;
        uint index;
    }

    event GiveAccess (
        bytes32 resource,
        bytes32 consentId,
        address researcher,
        address resourceOwner
    );

    event RevokeAccess (
        bytes32 resource,
        bytes32 consentId,
        address researcher
    );

    Consent public consent;
    mapping (bytes32 => mapping(bytes32 => ResourceAccess)) resourcesDetailsByConsent;
    mapping (bytes32 => bytes32[]) resourcesByConsent;
    mapping (bytes32 => mapping(bytes32 => mapping(address => bool))) resouceAccess;

    function initialize(Consent _consent) initializer public {
        consent = _consent;
        __Ownable_init();
        __UUPSUpgradeable_init();
    }

    function _authorizeUpgrade(address) internal override onlyOwner {}

    function giveAccess (bytes32 resource, bytes32 consentId, address researcher) external {
        require(consent.getConsent(consentId, msg.sender), "Consent not registered");

        if (!resourcesDetailsByConsent[consentId][resource].shared ) {
            resourcesByConsent[consentId].push(resource);
            resourcesDetailsByConsent[consentId][resource].user = msg.sender;
            resourcesDetailsByConsent[consentId][resource].resourceShared = resource;
            resourcesDetailsByConsent[consentId][resource].sharedDate = block.timestamp;
            resourcesDetailsByConsent[consentId][resource].shared = true;
            resourcesDetailsByConsent[consentId][resource].index = resourcesByConsent[consentId].length - 1;
        }

        resouceAccess[consentId][resource][researcher] = true;

        emit GiveAccess(resource, consentId, researcher, msg.sender);
    }

    function revokeAccess (bytes32 resource, bytes32 consentId, address researcher) external {
        require(resourcesDetailsByConsent[consentId][resource].user == msg.sender, "You are not the resource owner.");
        require(resouceAccess[consentId][resource][researcher], "The resource is not shared with this user.");

        resouceAccess[consentId][resource][researcher] = false;

        emit RevokeAccess(resource, consentId, researcher);
    }

    function checkAccess (bytes32 resource, bytes32 consentId) external view returns (bool) {
        require(resourcesDetailsByConsent[consentId][resource].sharedDate != 0, 
            "Resource is not registered in consent");
        require(resouceAccess[consentId][resource][msg.sender], "You don't have permission over this resource");

        return resourcesDetailsByConsent[consentId][resource].shared;
    }

    function getResourceByConsent (bytes32 consentId) external view returns (address[] memory, bytes32[] memory)
    {
        bytes32[] memory _resourcesByConsent = resourcesByConsent[consentId];

        address[] memory owners_ = new address[](_resourcesByConsent.length);
        bytes32[] memory resources_ = new bytes32[](_resourcesByConsent.length);

        for (uint i = 0; i < _resourcesByConsent.length; i++) {
            if (resourcesDetailsByConsent[consentId][_resourcesByConsent[i]].shared && 
                resouceAccess[consentId][_resourcesByConsent[i]][msg.sender]) 
            {
                owners_[i] = resourcesDetailsByConsent[consentId][_resourcesByConsent[i]].user;
                resources_[i] = resourcesDetailsByConsent[consentId][_resourcesByConsent[i]].resourceShared;
            }
        }

        return (owners_, resources_);
    }
}
